<script>

var regPeopleState;
var url = decodeURI(location.search);
var object = {};
if(url.indexOf("?") != -1)//url中存在问号，也就说有参数。  
{   
    var str = url.substr(1);  //得到?后面的字符串
    var strs = str.split("&");  //将得到的参数分隔成数组;
    for(var i = 0; i < strs.length; i ++)  
    {   
        object[strs[i].split("=")[0]]=strs[i].split("=")[1]
    }
}
regPeopleState=object.flag;
if(!object.flag){
    // datetimepicker
    $('#datetimepicker').datetimepicker({
    	format: 'yyyy-mm-dd',
    	autoclose: 1,
    	minView: 2	
    });
}
$('#datetimepicker').on('changeDate', function() {
    $('#validateForm').data('bootstrapValidator').updateStatus('birthday', 'NOT_VALIDATED').validateField('birthday');
});
// 表单验证

function cdbirthday(){
    var chusheng=$("#zjhm").val();
    
    var zhengjian=($("#zhengjian").val());
    if(zhengjian==1){
        if(chusheng.length==15){
            var chushengYear="19"+chusheng.substr(6,2);
            var chushengMonth=chusheng.substr(8,2);
            var chushengDay=chusheng.substr(10,2);
            var chushengSex=chusheng.substr(14,1);
            var chushengStr=chushengYear + "-" + chushengMonth + "-" + chushengDay;
            $('#datetimepicker').val(chushengStr);
            if(chushengSex%2==1){
                $("#sexman").prop("checked", true);
                $("#sexwoman").prop("checked", false);
            }
            else{
                $("#sexman").prop("checked", false);
                $("#sexwoman").prop("checked", true);
            }
        }
        else if(chusheng.length==18){
            var chushengYear=chusheng.substr(6,4);
            var chushengMonth=chusheng.substr(10,2);
            var chushengDay=chusheng.substr(12,2);
            var chushengSex=chusheng.substr(16,1);
            var chushengStr=chushengYear + "-" + chushengMonth + "-" + chushengDay;
            $('#datetimepicker').val(chushengStr);
            if(chushengSex%2==1){
                $("#sexman").prop("checked", true);
                $("#sexwoman").prop("checked", false);
            }
            else{
                $("#sexman").prop("checked", false);
                $("#sexwoman").prop("checked", true);
            }
        }
    }
}
setInterval("cdbirthday()",100);

$('#validateForm').bootstrapValidator({
    live: 'enabled',
    fields: {
        name:{
            validators: {
                notEmpty: {
                    message: '不能为空'
                },

                    regexp: /^[\u4E00-\u9FA5\uF900-\uFA2D\u0020·'"]*$/,
                    message: '请输入中文'
                }
            }
        },
        Certificates_num: {
            validators: {
                notEmpty: {
                    message: '不能为空'
                },
                callback: {
                    message: '内地居民身份证有误',
                    callback: function(value, validate) {
                        var Certificates_num_re = /(^\d{15}$)|(^\d{18}$)|(^\d{17}(\d|X|x)$)/;
                        if(($("#zhengjian").val()==1&&$("#zjhm").val()!='')&&(!Certificates_num_re.test($("#zjhm").val()))) {
                            return false;
                        } else {
                            return true;
                        }
                    }
                }
            }
        },
    }
});
